ed administrator, hereinafter called the </span> LESSOR <span style=\"font-weight:normal\"> .</span>\r\n          </span>\r\n        </div>\r\n        <div class=\"pos\" id=\"_409:453\" style=\"top:453;left:409\">\r\n          <span id=\"_16.3\" style=\"font-weight:bold; font-family:Arial; font-size:16.3px; color:#000000\"> AND</span>\r\n        </div>\r\n        <div class=\"pos\" id=\"_100:499\" style=\"top:499;left:100\">\r\n          <span id=\"_15.4\" style=\" font-family:Arial; font-size:15.4px; color:#000000\"> ________________________________________ of Legal Age, Married/ Single, with residence </span>\r\n        </div>\r\n        <div class=\"pos\" id=\"_189:499\" style=\"top:499;left:189\">\r\n          <span id=\"_13.4\" style=\"font-weight:bold; font-family:Arial; font-size:13.4px; color:#ff7c7f\" class=\"lessee\"> JOHANNAH P. NADELA</span>\r\n        </div>\r\n        <div class=\"pos\" id=\"_100:523\" style=\"top:523;left:100\">\r\n          <span id=\"_14.6\" style=\" font-family:Arial; font-size:14.6px; color:#000000\"> of _______________________________________, hereinafter called the <span style=\"font-weight:bold\"> LESEE</span> . </span>\r\n        </div>\r\n        <div class=\"pos\" id=\"_174:523\" style=\"top:523;left:174\">\r\n          <span id=\"_14.0\" style=\" font-family:Arial; font-size:14.0px; color:#000000\" class=\"address\"> Relis, Calajo-an, Minglanilla, Cebu</span>\r\n        </div>\r\n        <div class=\"pos\" id=\"_382:569\" style=\"top:569;left:382\">\r\n          <span id=\"_15.3\" style=\" font-family:Arial; font-size:15.3px; color:#000000\"> Withnesseth</span>\r\n        </div>\r\n        <div class=\"pos\" id=\"_99:616\" style=\"top:616;left:99\">\r\n          <span id=\"_15.3\" style=\" font-family:Arial; font-size:15.3px; color:#000000\"> WHEREAS the LESSOR operates the cemetery located at Poblacion Ward III, Minglanilla, Cebu, </span>\r\n        </div>\r\n        <div class=\"pos\" id=\"_99:640\" style=\"top:640;left:9