"top:1075;left:149\">\r\n          <span id=\"_15.3\" style=\" font-family:Arial; font-size:15.3px; color:#000000\"> title to said leased premises, as herein described shall immediately revert to the LESSOR </span>\r\n        </div>\r\n        <div class=\"pos\" id=\"_149:1098\" style=\"top:1098;left:149\">\r\n          <span id=\"_15.3\" style=\" font-family:Arial; font-size:15.3px; color:#000000\"> which shall have the right, power and authority to enforce the covenant.</span>\r\n        </div>\r\n        <div class=\"pos\" id=\"_124:1145\" style=\"top:1145;left:124\">\r\n          <span id=\"_15.3\" style=\" font-family:Arial; font-size:15.3px; color:#000000\"> 4. That the LESSOR has covenanted the responsibility of security, maintenance upkeep and </span>\r\n        </div>\r\n        <div class=\"pos\" id=\"_149:1168\" style=\"top:1168;left:149\">\r\n          <span id=\"_15.3\" style=\" font-family:Arial; font-size:15.3px; color:#000000\"> care of the leased premises.</span>\r\n        </div>\r\n        <div class=\"pos\" id=\"_0:0\" style=\"top:1300\">\r\n          <img name=\"_1300:850\" src=\"/img/contract/chamber/page_002.jpg\" height=\"1300\" width=\"850\" border=\"0\" usemap=\"#Map\">\r\n        </div>\r\n        <div class=\"pos\" id=\"_194:1516\" style=\"top: 1426px;left: 188px;\">\r\n        <span id=\"_13.5\" style=\"font-weight:bold; font-family:Arial; font-size:13.5px; color:#000000\" class=\"date_start\">\r\n        </span>\r\n        </div>\r\n        <div class=\"pos\" id=\"_194:1516\" style=\"top: 1426px;left: 420px;\">\r\n        <span id=\"_13.5\" style=\"font-weight:bold; font-family:Arial; font-size:13.5px; color:#000000\" class=\"date_expire\">\r\n        </span>\r\n        </div>\r\n        <div class=\"pos\" id=\"_194:1516\" style=\"top: 1838px;left: 410px;\">\r\n        <span id=\"_13.5\" style=\"font-weight:bold; font-family:Arial; font-size:13.5px; color:#000000\" class=\"date_start_day\">\r\n        </span>\r\n        </div>\r\n        <div class=\"pos\" id=\"_194:1516\" style=\"top: 1838px;left: 549px;\">\r\n        <span id=\"_13.5\" style=\"font-weight:bold; font-family:Arial; font-size:13.5px; color:#000000\" class=\"date_start_month\">\r\n        </span>\r\n        </div>\r\n        <div class=\"pos\" id=\"_194:1516\" style=\"top: 1838px;left: 698px;\">\r\n        <span id=\"_13.5\" style=\"font-weight:bold; font-family:Arial; font-size:13.5px; color:#000000\" class=\"date_start_year\">\r\n        </span>\r\n        </div>\r\n        <div class=\"pos\" id=\"_194:1516\" style=\"top: 2030px;left: 180px;\">\r\n        <span id=\"_13.5\" style=\"font-weight:bold; font-family:Arial; font-size:13.5px; color:#000000\" class=\"lessee_sign\">\r\n        </span>\r\n        </div>\r\n        <div class=\"pos\" id=\"_519:1514\"style=\"top: 2028px;left: 495px;\">\r\n        <span id=\"_13.5\" style=\"font-weight:bold; font-family:Arial; font-size:13.5px; color:#000000\" class=\"cemetery_administrator\">\r\n        </span>\r\n        </div>\r\n        <div class=\"pos\" id=\"_359:1686\" style=\"top: 2174px;left:359\">\r\n        <span id=\"_13.5\" style=\"font-weight:bold; font-family:Arial; font-size:13.5px; color:#000000\" class=\"parish_office\">\r\n        </span>\r\n        </div>\r\n        <div class=\"pos\" id=\"_158:1797\" style=\"top: 2281px;left:158\">\r\n        <span id=\"_13.5\" style=\"font-weight:bold; font-family:Arial; font-size:13.5px; color:#000000\" class=\"parish_moderator\">\r\n        </span>\r\n        </div>\r\n        <div class=\"pos\" id=\"_514:1796\" style=\"top:2281px;left: 475px;\">\r\n        <span id=\"_13.5\" style=\"font-weight:bold; font-family:Arial; font-size:13.5px; color:#000000\" class=\"parish_member\">\r\n        </span>\r\n        </div>\r\n      </nowrap>\r\n    </nobr>\r\n\r\n    <script src=\"/js/jquery-3.6.1.min.js\"></script>\r\n    <script>\r\n        $(document).ready(function() {\r\n\r\n            $.ajax({\r\n                type: \'GET\',\r\n                url: \'/defaults/list/json\',\r\n                success: function (response) {\r\n                    $(\'.cemetery_administrator\').html((response.data.cemetery_administrator).toUpperCase());\r\n                    $(\'.cemetery_administrator_case\').html(response.data.cemetery_administrator);\r\n                    $(\'.parish_office\').html(response.data.parish_office_staff);\r\n                    $(\'.parish_moderator\').html(response.data.parish_team_moderator);\r\n                    $(\'.parish_member\').html(response.data.parish_team_member);\r\n                } , error: function(e) {\r\n                    alert(\'Something Went Wrong\');\r\n                    location.href=\"/deceased\";\r\n                }\r\n            });\r\n\r\n            var getUrlParameter = function getUrlParameter(sParam) {\r\n                var sPageURL = window.location.search.substring(1),\r\n                    sURLVariables = sPageURL.split(\'&\'),\r\n                    sParameterName,\r\n                    i;\r\n\r\n                for (i = 0; i < sURLVariables.length; i++) {\r\n                    sParameterName = sURLVariables[i].split(\'=\');\r\n\r\n                    if (sParameterName[0] === sParam) {\r\n                        return sParameterName[1] === undefined ? true : decodeURIComponent(sParameterName[1]);\r\n                    }\r\n                }\r\n                return false;\r\n            };\r\n            $.ajax({\r\n            type: \'GET\',\r\n            url: \'/contract/\'+getUrlParameter(\'contract\'),\r\n            success: function (response) {\r\n                console.log(response);\r\n                let data = response.data;\r\n                let person = data.deceased.person;\r\n                let name = person.firstname+\' \'+(person.middlename == null ? \'\':person.middlename)+\' \'+(person.lastname == null ? \'\':person.lastname)+\' \'+(person.extension == null ? \'\':person.extension);\r\n                let lesse = (data.lessee).toUpperCase();\r\n\r\n                $(\'.lessee\').html(data.lessee);\r\n                $(\'.lessee_sign\').html(lesse);\r\n                $(\'.address\').html(data.address);\r\n                $(\'.contract_number\').html((data.contract_number).toUpperCase());\r\n                $(\'.vicinity\').html(data.deceased.vicinity ?? \'n/a\');\r\n                $(\'.location\').html(data.deceased.location ?? \'n/a\');\r\n                $(\'.deceased_name\').html(name.toUpperCase());\r\n                $(\'.date_start\').html(dateFormatter(data.date_start));\r\n                $(\'.date_expire\').html(dateFormatter(data.date_expire));\r\n                $(\'.date_start_day\').html(dateFormatter(data.date_start, false, true));\r\n                $(\'.date_start_month\').html(dateFormatter(data.date_start, true));\r\n                $(\'.date_start_year\').html(dateFormatter(data.date_start, false, false, true));\r\n\r\n\r\n                print();\r\n                setTimeout(function(){\r\n                    location.href=\"/deceased\";\r\n                },500);\r\n            }, error: function (e) {\r\n                console.log(e);\r\n            }\r\n        });\r\n        function dateFormatter(date, isMonth = false, isDay = false, isYear = false) {\r\n            if (date == \'\' || date == null || typeof(date) == \'undefined\') {\r\n                return \'n/a\';\r\n            }\r\n            const monthNames = [\"January\", \"February\", \"March\", \"April\", \"May\", \"June\",\r\n                \"July\", \"August\", \"September\", \"October\", \"November\", \"Dececember\"\r\n            ];\r\n            let newDate = new Date(date);\r\n            let day = newDate.getDate();\r\n            let month = monthNames[newDate.getMonth()];\r\n            let year = newDate.getFullYear();\r\n            let resultDate = month+\'. \'+day+\', \'+year;\r\n\r\n            if (isMonth) {\r\n                return month;\r\n            }\r\n\r\n            if (isDay) {\r\n                return day+nth(day);\r\n            }\r\n\r\n            if (isYear) {\r\n                return year.toString().substr(-2);\r\n            }\r\n\r\n            return resultDate == \'NaN-NaN-NaN\' ? \'\' : resultDate;\r\n        }\r\n        const nth = function(d) {\r\n            if (d > 3 && d < 21) return \'th\';\r\n                switch (d % 10) {\r\n                    case 1:  return \"st\";\r\n                    case 2:  return \"nd\";\r\n                    case 3:  return \"rd\";\r\n                    default: return \"th\";\r\n                }\r\n            }\r\n        });\r\n    </script>\r\n  </body>\r\n</html>', 'contract_number_field,lesse_field,address_field,date_start_field,date_expire_field', 2, 1, '2022-09-16 18:09:48', '2022-09-17 22:12:22');
